script: |
  super -f text -I q8529.spq | sort > q8529.out

inputs:
  - name: q8529.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE - col0 * col0 * col2 NOT BETWEEN ( + - col0 / - 88 + - col2 + 35 * - 87 - - col1 + col1 * - col0 ) AND NULL;
  - name: tab0

outputs:
  - name: q8529.out
    data: |
      15	81	47
      87	21	10
      97	1	99
